INSERT INTO `model` VALUES (395, 4, 13, 'VPS-001', 'VPS server includes web server setup and installation  (Yearly service/?????????)\r\n<br><b>Period: </b> \r\n<br> - NGINX \r\n<br> - Docker Container service\r\n<br> - SSL setup excludes license\r\n<br> - Standard basic security \r\n\r\n<br><b>- Support Service as Below:</b>\r\n<br>- Payment Gateway Service\r\n<br>- Google Mape/Google Place\r\n<br>- Backend and Frontend Service management and Dashboard ', 7200);
